import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Container, Row, Col} from 'react-bootstrap';

function App() {
  return (
    //React-boostrap
    <Container fluid>
      <Row>
        <Col>
          <img src='/images/taco-image.jpg' alt='Tacoventa'/>
        </Col>
        <cOL>2 of 2</cOL>
      </Row>
    </Container>
  );
}

export default App;
